import Vue from 'vue';
import App from './App.vue';
import VueRouter from 'vue-router';
import routes from './route'; // Importez les routes depuis route.js

Vue.config.productionTip = false;

Vue.use(VueRouter);

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes // Utilisez les routes importées depuis route.js
});

new Vue({
  router,
  render: h => h(App),
}).$mount('#app');
